staticBinding.value:
# Remove OS Cluster on OS and AD
Try{
    echo "Removing Cluster..."
	Remove-Cluster -CleanupAD -Force
}
Catch
{
	$ErrorMessage = $_.Exception.Message
	$FailedItem = $_.Exception.ItemName
	echo "Unable to remove cluster - $ErrorMessage, $FailedItem"
}

$strDomainName = CMD.EXE /C "$strSysDrive\Program Files\Opsware\agent_tools\get_cust_attr.bat" windows_domainname
$strDomainOU = CMD.EXE /C "$strSysDrive\Program Files\Opsware\agent_tools\get_cust_attr.bat" windows_domainou

$obj = Get-ADObject -Identity "CN=${clusterName},$strDomainOU"

if($obj)
{
    echo "Removing Cluster AD object..."
    Remove-ADComputer $obj -Confirm:$false
}
